import Button from "./Button"

const NavBar = () => {

    return (
        <div className='Nav-bar'>
            <Button text='About' handleClick={scroll('#body')}/>
            <Button text='Experience'/>
            <Button text='Contact'/>
        </div>
    )
}

export default NavBar
